★足を完全に包み込み、キッチンなどでこぼした液体からつま先を守ります。また履いている足にフィットするうえ、中底に血行促進ナブがあり一日中心地よく履くことが出来ます。さらに、ルーズフィットで足の曲げ伸ばしが自然に出来るため、足の疲れが軽減され、一日中キッチンで立ち仕事をする方に最適なフットウェアです。　　★汚れた床面、油、せっけんなど様々な滑りやすい環境に適したソール　★カラー　ブラック・ホワイト・ネイビー　★サイズ　２２ｃｍから３０ｃｍまで　★サイズをよく確認してご注文下さい<P>
